register_layout(source='CSC/Summary/All_DDUs_in_Readout', destination='CSC/Layouts/02 EMU Summary/All_DDUs_in_ReadoutAll_DDUs_in_Readout', name='EMU Test01 - DDUs in Readout', description='Number of Events in DDU. If Readout and Trigger Enable were started in a correct sequence (first, Readout Enable and, then, Trigger Enable) and the rate of events with CSC payload present is not too high (<100 CSCs with data per second per DDU) then all DDUs should give the exact same number of events. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_in_Readout">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_L1A_Increment', destination='CSC/Layouts/02 EMU Summary/All_DDUs_L1A_IncrementAll_DDUs_L1A_Increment', name='EMU Test01 - DDUs in Readout', description='L1A increment from event for each DDU. If Readout and Trigger Enable were started in a correct sequence (first, Readout Enable and, then, Trigger Enable) and the rate of events with CSC payload present is not too high (<100 CSCs with data per second per DDU) L1A increment from event to event must be 1. However, when the rate goes up, DAQ-DQM may not be able to keep up with the data and are designed to skip events. Occasional skips (L1A>1) will inevitably happen at low rates due to Poisson nature of cosmic ray rates. Under no circumstances, the incremental L1A can be zero. There should be no entries in the bottom row of bins of the bottom histogram. One may also want to flag runs with extremely non-uniform response DDUs. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_L1A_Increment">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_Trailer_Errors', destination='CSC/Layouts/02 EMU Summary/All_DDUs_Trailer_ErrorsAll_DDUs_Trailer_Errors', name='EMU Test03 - DDU Reported Errors', description='This histogram shows errors identified by DDU firmware and reported in the DDU trailer. Ideally, all entries should be in the bottom row of bins No Errors. However, this is not likely what one would typically see. Note that some of the errors are rather benign (e.g. #13 DAQ FIFO Near Full), while others are certainly very bad and may even require re-synchronization. The OR of all particularly bad errors in collected in bit #16 DDU Critical Error. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_Trailer_Errors">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_Format_Errors', destination='CSC/Layouts/02 EMU Summary/All_DDUs_Format_ErrorsAll_DDUs_Format_Errors', name='EMU Test04 - DDU Format Errors', description=' For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_Format_Errors">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_Live_Inputs', destination='CSC/Layouts/02 EMU Summary/All_DDUs_Live_InputsAll_DDUs_Live_Inputs', name='EMU Test05 - DDU Inputs Status', description='Inputs receiving a handshake from DMB (the handshake is obligatory, regardless of whether DMB has any data to report). If Readout and Trigger Enable were started in a correct sequence (first, Readout Enable and, then, Trigger Enable) and the rate of events with CSC payload present is not too high (<100 CSCs with data per second per DDU), the histogram should be absolutely flat for all DDUs and their enabled inputs. Otherwise histogram can show uneven response of DDUs when Readout was enabled after enabling the trigger (Test01 is even better suited to see this). This is not a normal sequence of run initialization. Under no circumstances, DDU inputs within one DDU may have different number of entries. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_Live_Inputs">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_Inputs_with_Data', destination='CSC/Layouts/02 EMU Summary/All_DDUs_Inputs_with_DataAll_DDUs_Inputs_with_Data', name='EMU Test05 - DDU Inputs Status', description='Inputs receiving DMB data. Is typically very uneven due to varying event rates from different chambers. The top example is typical of a single-CSC trigger. Particularly bad cases of hot chamber (chambers reporting data too frequently) can be easily spotted here - the bottom example illustrates such a problem. However, Test08 is much more suited for this. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_Inputs_with_Data">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_Inputs_Errors', destination='CSC/Layouts/02 EMU Summary/All_DDUs_Inputs_ErrorsAll_DDUs_Inputs_Errors', name='EMU Test06 - DDU Inputs in ERROR-WARNING State', description='Inputs in ERROR State. Normally all entries should appear in the bottom raw. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_Inputs_Errors">here.', overlay='')
register_layout(source='CSC/Summary/All_DDUs_Inputs_Warnings', destination='CSC/Layouts/02 EMU Summary/All_DDUs_Inputs_WarningsAll_DDUs_Inputs_Warnings', name='EMU Test06 - DDU Inputs in ERROR-WARNING State', description='Inputs in WARNING State. Normally all entries should appear in the bottom raw. This histogram can be ignored by a shifter. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#All_DDUs_Inputs_Warnings">here.', overlay='')
register_layout(source='CSC/Summary/CSC_Reporting', destination='CSC/Layouts/02 EMU Summary/CSC_ReportingCSC_Reporting', name='EMU Test08 - CSCs Reporting Data and Unpacked', description='The occupancy histogram shows CSCs reporting data, regardless of whether data format was intact or broken. Chambers within one raw belong to one 360 - ring of chamber. Note that ME +/- 2/1, 3/1, and 4/1 rings have only 18 20 -chambers, while all others have 36 10 -chambers. The rainbow pattern of color within one row is due to directionality of cosmic rays. At LHC, all chambers within one row should have equal occupancy. One should check that there are no new empty cells (check for the list of currently disabled CSCs) there are no hot CSCs. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_Reporting">here.', overlay='')
register_layout(source='CSC/Summary/CSC_Unpacked_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_Unpacked_FractCSC_Unpacked_Fract', name='EMU Test08 - CSCs Reporting Data and Unpacked', description='Histogram shows unpacking efficiency. Gross problems at a scale of >10% inefficiency can be easily seen as deviations from the flat red color corresponding to 100% efficiency. Smaller scale problems can be chased using the EMU Test10 canvas. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_Unpacked_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_Format_Errors_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_Format_Errors_FractCSC_Format_Errors_Fract', name='EMU Test10 - CSCs with Errors and Warnings (Fractions)', description='Histogram shows frequency of format errors per CSC record. Pay attention to the temperature scale (it changes from run to run and during a run according to the histogram content). CSCs reporting format errors in more than 1% of events should be flagged. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_Format_Errors_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_L1A_out_of_sync_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_L1A_out_of_sync_FractCSC_L1A_out_of_sync_Fract', name='EMU Test10 - CSCs with Errors and Warnings (Fractions)', description='(no description). For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_L1A_out_of_sync">here.', overlay='')
register_layout(source='CSC/Summary/CSC_DMB_input_fifo_full_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_DMB_input_fifo_full_FractCSC_DMB_input_fifo_full_Fract', name='EMU Test10 - CSCs with Errors and Warnings (Fractions)', description='Shows a frequency of FIFO-FULL condition on DMB inputs (OR of 7 FIFOs: 5 CFEBs, ALCT, TMB). Appearance of entries in this histogram is very bad and would typically imply a loss of synchronization, even if FIFO-FULL condition clears away. To dig out which of the 7 boards is actually responsible for the trouble, one needs to refer the FEB Status (Timeouts, FIFO, L1 pipe) canvas for the offensive chamber (this canvas can be found in the DMB group) For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_DMB_input_fifo_full_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_DMB_input_timeout_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_DMB_input_timeout_FractCSC_DMB_input_timeout_Fract', name='EMU Test10 - CSCs with Errors and Warnings (Fractions)', description='Shows a frequency of a TIMEOUT condition on DMB inputs (OR start/stop timeouts for 5 CFEBs, ALCT, TMB). Appearance of entries in this histogram is very bad and typically implies badly timed-in CSCs. To dig out which of the 7 boards is actually responsible for the trouble, one needs to refer the FEB Status (Timeouts, FIFO, L1 pipe) canvas for the offensive chamber (this canvas can be found in the DMB group) For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_DMB_input_timeout_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_wo_ALCT_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_wo_ALCT_FractCSC_wo_ALCT_Fract', name='EMU Test11 - CSCs without Data Blocks', description='Histogram shows how often CSC events come without ALCT data. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_wo_ALCT_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_wo_CLCT_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_wo_CLCT_FractCSC_wo_CLCT_Fract', name='EMU Test11 - CSCs without Data Blocks', description='Histogram shows how often CSC events come without CLCT data. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_wo_CLCT_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_wo_CFEB_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_wo_CFEB_FractCSC_wo_CFEB_Fract', name='EMU Test11 - CSCs without Data Blocks', description='Histogram shows how often CSC events come without CFEB data. For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_wo_CFEB_Fract">here.', overlay='')
register_layout(source='CSC/Summary/CSC_Format_Warnings_Fract', destination='CSC/Layouts/02 EMU Summary/CSC_Format_Warnings_FractCSC_Format_Warnings_Fract', name='EMU Test11 - CSCs without Data Blocks', description='Histogram shows occurrences when SCA cells were filled due to too-high rate of LCTs and/or LCT-L1A coincidences. In conditions of cosmic ray runs, appearance of entries is indicative of hardware problems, or more specifically hot CFEBs. This typically happens due to a loose CFEB-TMB cable generating a flood of CLCT pre-triggers (CBEBs are the only board that are readout on coincidence between pre-CLCT and L1A). For more information please click  href="https://twiki.cern.ch/twiki/bin/view/CMS/DQMShiftCSC#CSC_Format_Warnings_Fract">here.', overlay='')
